import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';
import logowhitetext from './logowhitetext.png';

function HeroSection() {
  return (
    <div className='hero-container'>
      <video src='/videos/vid.mp4' autoPlay loop muted />
      <div className="hero-section-left">
      <p>Top Level Tennis Training Program For Youth, Located in Mahwah, NJ. </p> 
      </div>

      <div className='hero-section-right'>

      <img src={logowhitetext} alt="GG Tennis Logo" id="herologo"></img>

        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
        Our Court Schedule
        </Button>
      </div>

    </div>
  );
}

export default HeroSection;
